import React, { Component } from 'react';
import './ListOfDoneProjs.css'

class ListOfDoneProjs extends Component {
	
	constructor(props) {
		super(props);
		
		this.createTask = this.createTask.bind(this);
	}
	
	undoTask(key) {
		this.props.undoElement(key);
	}
	
	delTask(key) {
		this.props.delElement(key);
	}
	
	createTask(proj) {
		if(proj.proj_done==1)
		{
			return (
				<div key={proj.proj_key} className="testing">
					<div onClick={() => {this.delTask(proj.proj_key)}}>
						<h5>delete</h5>
					</div>
					<div>
						{proj.proj_task}
					</div>
					<div onClick={() => {this.undoTask(proj.proj_key)}}>
						<h5>undo</h5>
					</div>
				</div>
				)
		}
	}
	
	render() {
		let list = this.props.projs.map((proj) => {return(this.createTask(proj))});
		console.log("done proj",list);
		return(
			<div>
				{list}
			</div>
		);
	}
}

export default ListOfDoneProjs;
